  let header = "This is a header";
  return (
    <div className="header">
      <h1>{header}</h1>
      <img src={logo} className="App-logo" alt="logo" />
      <p>lorem ipsum dolor sit</p>
      <button>Click Me!</button>
    </div>
  );
}

function Body() {
  return <h2>This is a body element</h2>;
}

function App() {
  return <Header />;
}

export default App;
